import (
	context "context"
	fern "github.com/pagination/fern"
	fernclient "github.com/pagination/fern/client"
	option "github.com/pagination/fern/option"
)

client := fernclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Complex.Search(
	context.TODO(),
	&fern.SearchRequest{
		Pagination: &fern.StartingAfterPaging{
			PerPage: 1,
			StartingAfter: fern.String(
				"starting_after",
			),
		},
		Query: fern.NewSearchRequestQueryFromSingleFilterSearchRequest(
			&fern.SingleFilterSearchRequest{
				Field: fern.String(
					"field",
				),
				Operator: fern.SingleFilterSearchRequestOperatorEquals,
				Value: fern.String(
					"value",
				),
			},
		),
	},
)

